import { Card } from "react-bootstrap";

const Home = () => {
    return (  
        <div>
            <Card className="m-4">
                <Card.Img className="w-50 p-3" src="https://www.ionos.fr/digitalguide/fileadmin/DigitalGuide/Teaser/e-commerce.jpg"></Card.Img>
                <Card.Body>
                    <Card.Title>Exemple</Card.Title>
                    <Card.Text>testing card</Card.Text>
                </Card.Body>
            </Card>
        </div>
    );
}
 
export default Home;
